import React, { useState } from "react";
import { manualPredict, csvPredict } from "../api";
import { useNavigate, Link } from "react-router-dom";

const mapEngagementLabel = (value) => {
  switch (value) {
    case 0:
      return "Low";
    case 1:
      return "Moderate";
    case 2:
      return "High";
    default:
      return "Unknown";
  }
};

const Dashboard = () => {
  const [studentId, setStudentId] = useState("");
  const [heartRate, setHeartRate] = useState("");
  const [skinConductance, setSkinConductance] = useState("");
  const [eeg, setEeg] = useState("");
  const [manualResult, setManualResult] = useState(null);
  const [manualFeedback, setManualFeedback] = useState("");

  const [csvFile, setCsvFile] = useState(null);
  const [csvResults, setCsvResults] = useState([]);
  const [csvError, setCsvError] = useState("");

  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/login");
  };

  const handleManualSubmit = async (e) => {
    e.preventDefault();
    setManualResult(null);
    setManualFeedback("");

    try {
      const data = {
        student_id: studentId,
        HeartRate: parseFloat(heartRate),
        SkinConductance: parseFloat(skinConductance),
        EEG: parseFloat(eeg),
      };
      const res = await manualPredict(data);
      setManualResult(res.data.EngagementLevel);
      setManualFeedback(res.data.Feedback || "");
    } catch (err) {
      alert(err.response?.data?.error || "Prediction failed");
    }
  };

  const handleCsvSubmit = async () => {
    setCsvResults([]);
    setCsvError("");

    if (!csvFile) {
      setCsvError("Please select a CSV file");
      return;
    }

    try {
      const res = await csvPredict(csvFile);
      setCsvResults(res.data);
    } catch (err) {
      setCsvError(err.response?.data?.error || "CSV Prediction failed");
    }
  };

  return (
    <div className="max-w-3xl mx-auto p-6">
      {/* Navigation Bar */}
      <nav className="mb-6 border-b border-gray-300 pb-3 flex flex-wrap items-center justify-between">
        <div className="space-x-4">
          <Link to="/dashboard" className="text-blue-600 hover:underline">
            Dashboard
          </Link>
          <Link to="/history" className="text-blue-600 hover:underline">
            History
          </Link>
          <Link to="/suggestion" className="text-blue-600 hover:underline">
            Suggestion
          </Link>
          <Link to="/profile" className="text-blue-600 hover:underline">
            Profile
          </Link>
        </div>
        <button
          onClick={handleLogout}
          className="text-white bg-red-500 hover:bg-red-600 px-3 py-1 rounded"
        >
          Logout
        </button>
      </nav>

      <h2 className="text-2xl font-semibold mb-4">Dashboard</h2>

      <section className="mb-10">
        <h3 className="text-xl font-semibold mb-3">Manual Input Prediction</h3>
        <form onSubmit={handleManualSubmit} className="space-y-4">
          <div>
            <label className="block mb-1 font-medium">Student ID</label>
            <input
              type="text"
              value={studentId}
              required
              onChange={(e) => setStudentId(e.target.value)}
              className="w-full border border-gray-300 rounded px-3 py-2 focus:outline-none focus:ring-2 focus:ring-blue-500"
            />
          </div>
          <div>
            <label className="block mb-1 font-medium">Heart Rate</label>
            <input
              type="number"
              step="0.01"
              value={heartRate}
              required
              onChange={(e) => setHeartRate(e.target.value)}
              className="w-full border border-gray-300 rounded px-3 py-2 focus:outline-none focus:ring-2 focus:ring-blue-500"
            />
          </div>
          <div>
            <label className="block mb-1 font-medium">Skin Conductance</label>
            <input
              type="number"
              step="0.01"
              value={skinConductance}
              required
              onChange={(e) => setSkinConductance(e.target.value)}
              className="w-full border border-gray-300 rounded px-3 py-2 focus:outline-none focus:ring-2 focus:ring-blue-500"
            />
          </div>
          <div>
            <label className="block mb-1 font-medium">EEG</label>
            <input
              type="number"
              step="0.01"
              value={eeg}
              required
              onChange={(e) => setEeg(e.target.value)}
              className="w-full border border-gray-300 rounded px-3 py-2 focus:outline-none focus:ring-2 focus:ring-blue-500"
            />
          </div>
          <button
            type="submit"
            className="mt-2 bg-blue-600 hover:bg-blue-700 text-white px-4 py-2 rounded"
          >
            Predict Now
          </button>
        </form>
        {manualResult !== null && (
          <div className="mt-4 bg-gray-100 p-4 rounded border border-gray-300">
            <p>
              <strong>Predicted Engagement Level: </strong>{" "}
              {mapEngagementLabel(manualResult)}
            </p>
            <p>
              <strong>Feedback: </strong> {manualFeedback}
            </p>
          </div>
        )}
      </section>

      <section>
        <h3 className="text-xl font-semibold mb-3">Upload CSV File</h3>
        <p className="text-sm mb-2 text-gray-600">
          CSV must include columns: student_id, HeartRate, SkinConductance, EEG
        </p>
        <div className="flex items-center space-x-4">
          <input
            type="file"
            accept=".csv"
            onChange={(e) => setCsvFile(e.target.files[0])}
            className="border border-gray-300 rounded px-3 py-2"
          />
          <button
            onClick={handleCsvSubmit}
            className="bg-blue-600 hover:bg-blue-700 text-white px-4 py-2 rounded"
          >
            Predict CSV
          </button>
        </div>
        {csvError && <p className="text-red-600 mt-2">{csvError}</p>}

        {csvResults.length > 0 && (
          <div className="overflow-x-auto mt-4">
            <table className="min-w-full border border-gray-300 border-collapse">
              <thead className="bg-gray-200">
                <tr>
                  <th className="border border-gray-300 px-3 py-2 text-left">Student ID</th>
                  <th className="border border-gray-300 px-3 py-2 text-left">HeartRate</th>
                  <th className="border border-gray-300 px-3 py-2 text-left">SkinConductance</th>
                  <th className="border border-gray-300 px-3 py-2 text-left">EEG</th>
                  <th className="border border-gray-300 px-3 py-2 text-left">Predicted Engagement Level</th>
                  <th className="border border-gray-300 px-3 py-2 text-left">Feedback</th>
                </tr>
              </thead>
              <tbody>
                {csvResults.map((row, i) => (
                  <tr
                    key={i}
                    className={i % 2 === 0 ? "bg-white" : "bg-gray-50"}
                  >
                    <td className="border border-gray-300 px-3 py-2">
                      {row.student_id || row.studentId || "N/A"}
                    </td>
                    <td className="border border-gray-300 px-3 py-2">{row.HeartRate}</td>
                    <td className="border border-gray-300 px-3 py-2">{row.SkinConductance}</td>
                    <td className="border border-gray-300 px-3 py-2">{row.EEG}</td>
                    <td className="border border-gray-300 px-3 py-2">
                      {mapEngagementLabel(row.PredictedEngagementLevel)}
                    </td>
                    <td className="border border-gray-300 px-3 py-2">
                      {row.Feedback || ""}
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </section>
    </div>
  );
};

export default Dashboard;
